function FilterStatus() {
  return (
    <div className="btn-group">
      <input type="radio" className="btn-check" name="options" id="all-select"></input>
      <label className="btn btn-outline-dark" for="all-select">
        <i className="fa-solid fa-list" />
      </label>
      <input type="radio" className="btn-check" name="options" id="done-select"></input>
      <label className="btn btn-outline-dark" for="done-select">
        <i class="fa-sharp fa-solid fa-check-to-slot"></i>
      </label>
      <input type="radio" className="btn-check" name="options" id="doing-select"></input>
      <label className="btn btn-outline-dark" for="doing-select">
        <i class="fa-thin fa-check-to-slot"></i>
      </label>
    </div>
  );
}
export default FilterStatus;
